(172, 23, 'hakkimizda_alt_baslik', 'AKLINI DİNLENDİREN,RUHUNU YENİLEYEN GÜZELLİKLER İYİ GELİR'),
(173, 23, '_hakkimizda_alt_baslik', 'field_626054a3d397f'),
(174, 23, 'hakkimizda_icerik', '<p class=\"font_8\" style=\"text-align: center;\"><span class=\"color_29\">Çiçekler doğanın mucizesi. </span></p>\r\n<p class=\"font_8\" style=\"text-align: center;\"><span class=\"color_29\">İyileştiren, huzur ve mutluluk veren, güzellikleriyle ilham olan.</span></p>\r\n<p class=\"font_8\" style=\"text-align: center;\"><span class=\"color_29\"><span class=\"wixGuard\">​</span></span></p>\r\n<p class=\"font_8\" style=\"text-align: center;\"><span class=\"color_29\">VOS çiçekleri, onlardan alınan ilham ve büyük bir heyecanla hazırlandı.</span></p>\r\n<p class=\"font_8\" style=\"text-align: center;\"><span class=\"color_29\">Her biri biricik ve çok özel. Tıpkı siz ve sevdikleriniz gibi.</span></p>\r\n&nbsp;\r\n<p class=\"font_8\" style=\"text-align: center;\">VOS heyecan dolu, naif aynı zamanda çok güçlü bir çabanın ve inancın adı.</p>\r\n<p class=\"font_8\" style=\"text-align: center;\">Şimdi büyüyen biricik ekibiyle ve tabi ki sizlerin eşsiz sevgisiyle yoluna devam ediyor.</p>'),
(175, 23, '_hakkimizda_icerik', 'field_626054b6d3980'),
